import React from "react";
import store from "../store";

let employees = [
  {
    firstName: "John",
    lastName: "Doe",
    age: 27,
    joinedDate: "December 15, 2017",
  },

  {
    firstName: "Ana",
    lastName: "Rosy",
    age: 25,
    joinedDate: "January 15, 2019",
  },

  {
    firstName: "Zion",
    lastName: "Albert",
    age: 30,
    joinedDate: "February 15, 2011",
  },
];
const employeesSort = employees.sort((a, b) => {
  return a.firstName - b.firstName;
});

employeesSort.forEach((e) => {
  console.log(`${e.firstName}`);
});

const clientData = store.getState().clientReducer;

const clientItems = clientData.map((item) => (
  <li key={item.id}>{item.first_name}</li>
));

export default function Clients() {
  return <div>{clientItems}</div>;
}
